import './App.css';
import { Container } from "@mui/material";
import ToDoList from "./pages/ToDoList"

function App() {
    return (
        <Container maxWidth="sm" style={{textAlign: "center"}}>
            <h1> ToDo List </h1>
            <ToDoList/>
        </Container>
    );
}

export default App;
